כמו כן, באחריותך לוודא שכל הקישורים ימשיכו לקשר למקומות הם אמורים לקשר שאליהם.

יש לשים לב לכך שהדף <strong>לא</strong> יועבר אם כבר יש דף בשם החדש, אלא אם כן הדף עם השם החדש הוא הפניה ואין לו עריכות קודמות.
זה אומר שניתן יהיה להחזיר את הדף לשם המקורי במקרה שתיעשה טעות, אבל לא ניתן לדרוס דף קיים.

