:* הורדת [https://www.mediawiki.org/wiki/Download קובץ ה־tar להתקנה], שכולל כמה עיצובים והרחבות. באפשרותכם להעתיק ולהדביק מתוכו את תיקיית ה‏‏־<code>skins/</code>.
:* הורדת קובצי tar של עיצובים מסוימים מ־[https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].
:* [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins שימוש ב־Git כדי להוריד עיצובים].
