	'messages:apihelp-main-extended-description' => 'he:<div class="hlist plainlinks api-main-links">
* [[mw:Special:MyLanguage/API:Main_page|תיעוד]]
* [[mw:Special:MyLanguage/API:Etiquette|כללי נימוסין והנחיות שימוש]]
* [[mw:Special:MyLanguage/API:FAQ|שו"ת]]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ רשימת תפוצה]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/ הודעות על API]
* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R באגים ובקשות]
</div>
<strong>מצב:</strong> ה־API של מדיה־ויקי הוא ממשק ותיק ויציב שנתמך ומשתפר באופן סדיר. אף שאנחנו משתדלים להימנע מכך, לעיתים עלינו לבצע שינויים שעלולים לשבש דברים בפונקציונליות הזאת; באפשרותך לעשות מינוי ל[https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ רשימת התפוצה mediawiki-api-announce] כדי לקבל הודעות על עדכונים.

<strong>בקשות שגויות:</strong> כשבקשות שגויות נשלחות ל־API, יישלח כותר HTTP עם המפתח "MediaWiki-API-Error", ואז גם הערך של הכותר וגם קוד השגיאה יוגדרו לאותו ערך. למידע נוסף, אפשר לעיין בדף [[mw:Special:MyLanguage/API:Errors_and_warnings|API:שגיאות ואזהרות]].

<p class="mw-apisandbox-link"><strong>בדיקה:</strong> לבדיקה קלה יותר של בקשות, אפשר להשתמש ב[[Special:ApiSandbox|ארגז החול של API]].</p>',
	'messages:apihelp-main-param-action' => 'he:איזו פעולה לבצע.',
	'messages:apihelp-main-param-format' => 'he:תסדיר הפלט.',
	'messages:apihelp-main-param-maxlag' => 'he:שיהוי מרבי יכול לשמש כשמדיה־ויקי מותקנת באשכול עם מסד נתונים משוכפל. כדי לחסוך בפעולות שגורמות יותר שיהוי בשכפול אתר, הפרמטר הזה יכול לגרום ללקוח להמתין עד ששיהוי השכפול יורד מתחת לערך שצוין. במקרה של שיהוי מוגזם, קוד השגיאה <samp>maxlag</samp> מוחזר עם הודעה כמו <samp>Waiting for $host: $lag seconds lagged</samp>.<br />ר\' [[mw:Special:MyLanguage/Manual:Maxlag_parameter|מדריך למשתמש: פרמטר maxlag]] למידע נוסף.',
	'messages:apihelp-main-param-smaxage' => 'he:להגדיר את כותר <code dir="ltr">s-maxage</code> לבקרת מטמון HTTP‏ למספר כזה של שניות. שגיאות אף פעם לא מוטמנות.',
	'messages:apihelp-main-param-maxage' => 'he:להגדיר את כותר <code dir="ltr">max-age</code> לבקרת מטמון HTTP‏ למספר כזה של שניות. שגיאות אף פעם לא מוטמנות.',
	'messages:apihelp-main-param-assert' => 'he:לוודא שהמשתמש נכנס לחשבון (וייתכן שבתור חשבון חולף) אם זה מוגדר ל־<kbd>user</kbd>, ש<em>לא</em> נכנס לחשבון אם מוגדר <kbd>anon</kbd>, או שיש לו הרשאת המשתמש "בוט" אם זה <kbd>bot</kbd>.',
	'messages:apihelp-main-param-assertuser' => 'he:לוודא שהמשתמש הנוכחי הוא המשתמש ששמו ניתן.',
	'messages:apihelp-main-param-requestid' => 'he:כל ערך שיינתן כאן ייכלל בתשובה. אפשר להשתמש בזה כדי להבדיל בין בקשות.',
	'messages:apihelp-main-param-servedby' => 'he:לכלול את שם המארח ששירת את הבקשה בתוצאות.',
	'messages:apihelp-main-param-curtimestamp' => 'he:לכלול את חותם־הזמן הנוכחי בתוצאה.',
	'messages:apihelp-main-param-responselanginfo' => 'he:לכלול את השפות שמשמשות ל־<var>uselang</var> ול־<var>errorlang</var> בתוצאה.',
	'messages:apihelp-main-param-origin' => 'he:בעת גישה ל־API עם בקשת AJAX חוצה תחומים (CORS), יש להציב כאן את התחום שהבקשה יוצאת ממנו. זה היה להיות כלול בכל בקשה מקדימה, ולכן הוא חייב להיות חלק מה־URI של הבקשה (לא גוף ה־POST).

עבור בקשות מאומתות, זה חייב להיות תואם במדויק לאחד המקורות בכותרת <code>Origin</code>, כך שזה צריך להיות מוגדר למשהו כמו <kbd>https://en.wikipedia.org</kbd> או <kbd>https://meta.wikimedia.org</kbd>. אם הפרמטר הזה אינו תואם לכותרת <code>Origin</code>, תוחזר תשובת 403. אם הפרמטר הזה תורם לכותרת <code>Origin</code> והמקור מורשה, תוגדרנה הכותרות <code>Access-Control-Allow-Origin</code> ו־<code>Access-Control-Allow-Credentials</code>.

עבור בקשות בלתי־מאומתות, יש לציין את הערך <kbd>*</kbd>. זה יגרום לכותרת להיות <code>Access-Control-Allow-Origin</code>, אבל <code>Access-Control-Allow-Credentials</code> תהיה <code>false</code> וכל הנתונים הייחודיים למשתמש יהיו מוגבלים.',
	'messages:apihelp-main-param-crossorigin' => 'he:בעת גישה לממשק ה־API באמצעות בקשת AJAX חוצה־תחומים (CORS) ושימוש בספק התחברות (session) מאובטח מפני מתקפות זיוף בקשות חוצות אתרים (CSRF), כגון OAuth, יש להשתמש בזה ולא ב־<code dir="rtl">origin=*</code> כדי לאמת את הבקשה (כלומר, שהיא לא תהיה של משתמש שלא נכנס לחשבון). זה חייב להיכלל בכל בקשה לפני טיסה, ולכן חייב להיות חלק מה־URI של הבקשה (ולא בגוף ה־POST).

נא לשים לב לכך שרוב ספקי ההתחברות, כולל התחברויות תקניות שמבוססות על עוגיות, אינם תומכים ב־CORS מאומת ולא ניתן להשתמש בהם עם הפרמטר הזה.',
	'messages:apihelp-main-param-uselang' => 'he:באיזו שפה להשתמש לתרגומי הודעות. הקריאה <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> מחזירה רשימת קודים. באפשרותך לציין <kbd>user</kbd> כדי להשתמש בהעדפת השפה של המשתמש הנוכחי או <kbd>content</kbd> כדי להשתמש בשפת התוכן של הוויקי הזה.',
	'messages:apihelp-main-param-variant' => 'he:הגוון השפה. עובד רק אם השפה הבסיסית תומכת בהמרה בין הגוונים.',
	'messages:apihelp-main-param-errorformat' => 'he:תסדיר לשימוש בפלט טקסט אזהרות ושגיאות',
	'messages:apihelp-main-paramvalue-errorformat-plaintext' => 'he:קוד ויקי שתגי HTML הוסרו ממנו והישויות הוחלפו בו.',
