	'messages:apihelp-main-paramvalue-errorformat-bc' => 'he:התסדיר ששימש לפני מדיה־ויקי 1.29. התעלמות מ־<var>errorlang</var> ו־ <var>errorsuselocal</var>.',
	'messages:apihelp-main-param-errorlang' => 'he:באיזו שפה להשתמש לאזהרות ושגיאות. הקריאה <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> מחזירה רשימת קודים. באפשרותך לציין <kbd>content</kbd> כדי להשתמש בשפת התוכן של הוויקי הזה או <kbd>uselang</kbd> כדי להשתמש אותו הערך שיש בפרמטר <var>uselang</var>.',
	'messages:apihelp-main-param-errorsuselocal' => 'he:אם ניתן, הטקסטים של השגיאות ישתמשו בהודעות מותאמות מקומית ממרחב השם {{ns:MediaWiki}}.',
	'messages:apihelp-acquiretempusername-summary' => 'he:קבלת שם חשבון חולף ואחסונו במאגר של ההתחברות הנוכחית, אם יצירת חשבון חולף מופעלת והמשתמש הנוכחי לא נכנס לחשבון. אם כבר נשמר שם במאגר, מוחזר אותו השם.',
	'messages:apihelp-acquiretempusername-extended-description' => 'he:אם המשתמש מבצע מאוחר יותר פעולה שמובילה ליצירת חשבון חולף, שם המשתמש שנשמר במאגר ישמש עבור אותו החשבון. הוא יכול לשמש גם בתצוגה מקדימה. עם זאת, החשבון עדיין לא נוצר, ומשתמשים אחרים לא יכולים לראות את השם.',
