	'messages:apihelp-block-param-reblock' => 'he:אם המשתמש כבר חסום על־ידי חסימה בודדת, להחליף את החסיהמ הקיימת. אם המשתמש נחסם יותר מפעם אחת, זה ייכשל – יש להשתמש בפרמטר <var>id</var> במקום זאת כדי לציין איזו חסימה להחליף.',
