	'messages:apihelp-query+revisions+base-param-slots' => 'he:עבור אילו משבצות תוכן להחזיר נתונים, כאשר מאפיינים שקשורים למשבצת כלולים ב־<var>$1props</var>. אם זה מושמט, נתונים ממשבצת <kbd>main</kbd> יוחזרו בתסדיר תואם לאחור.',
