	'messages:apihelp-query+revisions+base-param-expandtemplates' => 'he:יש להשתמש ב־<kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> במקום בזה. לפרוס תבניות בתוכן הגרסה (דורש $1prop=content).',
