	'messages:apihelp-query+revisions+base-param-parse' => 'he:יש להשתמש ב־<kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> במקום בזה. פענוח תוכן הגרסה (דורש <var dir="ltr">$2prop=content</var>). מטעמי ביצועים, אם האפשרות הזאת משמשת, הערך של <var dir="ltr">$2limit</var> יחויב להיות $1.',
