	'messages:api-help-datatypes-header' => 'he:סוגי נתונים',
	'messages:api-help-datatypes-top' => 'he:קלט למדיה־ויקי אמור להיות UTF-8 מנורמל לפי NFC. מדיה־ויקי יכולה לנסות להמיר קלט אחר, אבל זה יכול לגרום לפעולות מסוימות (כגון [[Special:ApiHelp/edit|עריכות]] עם בדיקות MD5) להיכשל.

פרמטרים שיכולים לקחת ערכים מרובים בדרך־כלל נשלחים עם ערכים מופרדים באמצעות תו קו ניצב, למשל <kbd>param=value1|value2</kbd> או <kbd>param=value1%7Cvalue2</kbd>. אם הערך צריך להכיל את תו הקו הניצב, יש להשתמש בתו U+001F (מפריד יחידות, Unit Separator) בתור מפריד \'\'וגם\'\' להוסיף לתחילת הערך את התו U+001F, למשל <kbd>param=%1Fvalue1%1Fvalue2</kbd>.

כמה סוגי פרמטרים ב־API דורשים הסבר נוסף:',
	'messages:api-help-datatype-boolean' => 'he:פרמטרים בוליאניים עובדים כמו תיבות סימון ב־HTML: אם הפרמטר צוין, בלי קשר לערך שלו, הוא יטופל בתור אמת. בשביל ערך שקר, יש להשמיט את הפרמטר לגמרי.',
	'messages:api-help-datatype-expiry' => 'he:ערכי תפוגה יכולים להיות יחסיים (למשל <kbd dir="ltr">5 months</kbd> או <kbd dir="ltr">2 weeks</kbd>) או מוחלטים (למשל <kbd dir="ltr">2014-09-18T12:34:56Z</kbd>). כדי שלא תהיה תפוגה, יש להשתמש ב־<kbd dir="ltr">infinite</kbd>, <kbd dir="ltr">indefinite</kbd>, <kbd dir="ltr">infinity</kbd>, או <kbd dir="ltr">never</kbd>.',
	'messages:api-help-datatype-timestamp' => 'he:חותמי־זמן יכולים להיות כתובים בכמה תסדירים, ר\' [[mw:Special:MyLanguage/Timestamp|את התיעוד של תסדירי קלט של ספריית Timestamp]] לפרטים. מומלץ להשתמש בתאריך ושעה לפי ISO 8601, כך: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. בנוסף, המחרוזת <kbd>now</kbd> יכולה לשמש לציון חותם־הזמן הנוכחי.',
	'messages:api-help-templatedparams-header' => 'he:פרמטרים בתבניות',
	'messages:api-help-templatedparams' => 'he:התכונה "פרמטרים בתבניות" תומכת במקרים שבהם מודול של API זקוק לערך כלשהו עבור ערכים של פרמטרים אחרים. למשל, אם היה מודול API לבקשת פרי, ייתכן שהוא היה זקוק לפרמטר בשם <var>פירות</var> כדי לציין מהם הפירות המבוקשים, ולפרמטר בתבנית בשם <var>{פרי}-כמות</var> כדי לציין את הכמות של כל פרי עבור הבקשה. לשם כך, לקוח API שמעוניין לקבל תפוח אחד, 5 בננות ו־20 תותים יכול היה ליצור בקשה בסגנון <kbd>פירות=תפוחים|בננות|תותים&תפוחים-כמות=1&בננות-כמות=5&תותים-כמות=20</kbd>.',
	'messages:api-help-param-type-expiry' => 'he:סוג: {{PLURAL:$1|1=תפוגה|2=רשימת תפוגות}} ([[Special:ApiHelp/main#main/datatype/expiry|פרטים]])',
	'messages:api-help-param-type-limit' => 'he:סוג: מספר שלם או <kbd>max</kbd>',
	'messages:api-help-param-type-presenceboolean' => 'he:סוג: בוליאני ([[Special:ApiHelp/main#main/datatype/boolean|פרטים]])',
	'messages:api-help-param-type-timestamp' => 'he:סוג: {{PLURAL:$1|חותם־זמן|רשימת חותמי־זמן}} ([[Special:ApiHelp/main#main/datatype/timestamp|תסדירים מורשים]])',
	'messages:api-help-param-type-enum' => 'he:{{PLURAL:$1|1=אחד מהערכים הבאים|2=ערכים (מופרדים באמצעות "<kbd>{{!}}</kbd>" או or [[Special:ApiHelp/main#main/datatypes|תו חלופי]])}}: $2',
	'messages:api-help-param-multi-separate' => 'he:הפרדה בין ערכים נעשית באמצעות <kbd>|</kbd> או [[Special:ApiHelp/main#main/datatypes|תו חלופי]].',
	'messages:api-help-param-multi-all' => 'he:כדי לתת את כל הערכים, יש להשתמש ב־<kbd>$1</kbd>.',
	'messages:api-help-param-default-empty' => 'he:ברירת מחדל: <span class="apihelp-empty">(ריק)</span>',
	'messages:api-help-param-token' => 'he:אסימון "$1" שאוחזר מ־[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]',
	'messages:api-help-param-token-webui' => 'he:לשם תאימות, גם האסימון שמשמש בממשק דפדפן מתקבל.',
	'messages:api-help-param-disabled-in-miser-mode' => 'he:כבוי בשל [[mw:Special:MyLanguage/Manual:$wgMiserMode|מצב חיסכון]].',
	'messages:api-help-param-limited-in-miser-mode' => 'he:<strong>לתשומת ליבך:</strong> בשל [[mw:Special:MyLanguage/Manual:$wgMiserMode|מצב חיסכון]], שימוש בזה יכול להוביל לפחות מ־<var>$1limit</var> תוצאות לפני המשך; במצבים קיצוניים ייתכן שיחזרו אפס תוצאות.',
	'messages:api-help-param-direction' => 'he:באיזה כיוון למנות:',
	'messages:api-help-paramvalue-direction-newer' => 'he:לרשום את הישנים ביותר בהתחלה. לתשומת ליבך: $1start חייב להיות לפני $1end.',
	'messages:api-help-paramvalue-direction-older' => 'he:לרשום את החדשים ביותר בהתחלה (ברירת מחדל). לתשומת ליבך: $1start חייב להיות אחרי $1end.',
	'messages:api-help-param-continue' => 'he:כשיש עוד תוצאות, להשתמש בזה בשביל להמשיך. אפשר למצוא [[mw:Special:MyLanguage/API:Continue|מידע מפורט יותר על איך להמשיך שאילתות באתר mediawiki.org]].',
	'messages:api-help-param-no-description' => 'he:<span class="apihelp-empty">(ללא תיאור)</span>',
	'messages:api-help-examples' => 'he:{{PLURAL:$1|דוגמה|דוגמאות}}:',
	'messages:api-help-permissions' => 'he:{{PLURAL:$1|הרשאה|הרשאות}}:',
	'messages:api-help-permissions-granted-to' => 'he:{{PLURAL:$1|הוענק ל|הוענקו ל}}: $2',
	'messages:api-help-right-apihighlimits' => 'he:להשתמש במגבלות גבוהות יותר בשאילתות API (שאילתות איטיות: $1; שאילתות מהירות: $2). המגבלות לשאילתות איטיות חלות גם על פרמטרים מרובי־ערכים.',
	'messages:api-help-open-in-apisandbox' => 'he:<small>[פתיחה בארגז חול]</small>',
	'messages:api-help-authmanager-general-usage' => 'he:הנוהל הכללי לשימוש במודול הזה הוא:
# אחזור השדות הזמינים מ־<kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> עם <kbd>amirequestsfor=$4</kbd> ואסימון <kbd>$5</kbd> מתוך <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.
# הצגת השדות למשתמש וקבלת אישור ממנו.
# שליחה (Post) למודול הזה עם <var>$1returnurl</var> וכל השדות הרלוונטיים.
# בדיקת ה־<samp>status</samp> בתשובה.
#* אם קיבלת <samp>PASS</samp> או <samp>FAIL</samp>, זה הסיום. הפעולה שלך הצליחה או נכשלה.
#* אם קיבלת <samp>UI</samp>, יש להציג את השדות החדשים למשתמש ולקבל את מה שהוא ישלח. אחר־כך יש לשלוח (post) למודול הזה עם <var>$1continue</var> ועם הגדרות של השדות הרלוונטיים ולחזור על צעד 4.
#* אם קיבלת <samp>REDIRECT</samp>, יש להפנות את המשתמש ל־<samp>redirecttarget</samp> ולחכות לחזרה אל <var>$1returnurl</var>. אחר־כך לשלוח (post) למודול הזה עם <var>$1continue</var> ועם כל השדות שהועברו ל־URL שחוזרים אליו ולחזור על צעד 4.
#* אם קיבלת <samp>RESTART</samp>, זה אומר שהאימות עבד אבל אין חשבון משתמש מקושר. באפשרותך לטפל בזה כמו ב־<samp>UI</samp> או ב־<samp>FAIL</samp>.',
	'messages:api-help-authmanagerhelper-requests' => 'he:להשתמש רק בבקשות האימות האלו, מאת <samp>id</samp> שהוחזר מ־<kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> עם <kbd>amirequestsfor=$1</kbd> או מתשובה קודמת למודול הזה.',
	'messages:api-help-authmanagerhelper-request' => 'he:להשתמש בבקשת האימות הזאת, מאת <samp>id</samp> שהוחזר מ־<kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> עם <kbd>amirequestsfor=$1</kbd>.',
	'messages:api-help-authmanagerhelper-messageformat' => 'he:תסדיר לשימוש בהחזרת הודעות.',
	'messages:api-help-authmanagerhelper-mergerequestfields' => 'he:מיזוג מידע של שדות עבור כל בקשות האימות למערך אחד.',
	'messages:api-help-authmanagerhelper-preservestate' => 'he:שימור מצב מניסיון כניסה קודם, אם אפשר.',
	'messages:api-help-authmanagerhelper-returnurl' => 'he:כתובת URL לחזרה עם זרימות אימות צד־שלישי, חייב להיות מוחלט. נדרש או זה או <var>$1continue</var>.

עם קבלת תשובת <samp>REDIRECT</samp>, בדרך־כלל תפתח דפדפן או תצוגת וב בכתובת ה־<samp>redirecttarget</samp> שצוינה בשביל זרימת אימות צד־שלישי. כשזה יושלם, הצד השלישי ישלח את הדפדפן או את תצוגת הווב לכתובת הזאת. יש לחלץ את כל הפרמטרים של שאילתה או בקשת POST מה־URL ולהעביר אותם בתור בקשת <var>$1continue</var> למודול ה־API הזה.',
	'messages:api-help-authmanagerhelper-continue' => 'he:הבקשה הזאת היא המשך אחרי תשובת <samp>UI</samp> או <samp>REDIRECT</samp> קודמת. נדרש זה או <var>$1returnurl</var>.',
	'messages:api-help-authmanagerhelper-additional-params' => 'he:המודול הזה מקבל פרמטרים נוספים בהתאם לבקשות אימות זמינות. יש להשתמש ב־<kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> עם <kbd>amirequestsfor=$1</kbd> (או תשובה קודמת מהמודול הזה, אם זה זמין) כדי להבין מה הבקשות הזמינות ובאילו שדות הן משתמשות.',
	'messages:apierror-allimages-redirect' => 'he:יש להשתמש ב־<kbd>gaifilterredir=nonredirects</kbd> במקום ב־<var>redirects</var> בעת שימוש ב־<kbd>allimages</kbd> בתור מחולל.',
	'messages:apierror-allpages-generator-redirects' => 'he:יש להשתמש ב־<kbd>gaifilterredir=nonredirects</kbd> במקום ב־<var>redirects</var> בעת שימוש ב־<kbd>allpages</kbd> בתור מחולל.',
