	'messages:config-welcome' => 'he:מדיה-ויקי היא חבילת תכנה של ויקי בחינם ובקוד פתוח שנכתבה ב־PHP. היא משרתת כבסיס לוויקיפדיה ומגוון מיזמים אחרים של ויקימדיה, משמשת מאות מיליוני אנשים מדי חודש. מדיה־ויקי מתורגמת ללמעלה מ־350 שפות והאמינות וסדרת התכונות שלה הקנתה לה קהילה גדולה ונמרצת של משתמשי צד־שלישי ומפתחים.
=== בדיקות סביבה ===
בדיקות בסיסיות תתבצענה עכשיו כדי לראות אם הסביבה הזאת מתאימה להתקנת מדיה־ויקי.
