התוכנית הזאת מופצת בתקווה שתהיה מועילה, <strong>אבל בלא אחריות כלשהי</strong>; ואפילו ללא האחריות המשתמעת בדבר <strong>מסחריותה\'\'\' או <strong>התאמתה למטרה מסוימת\'\'\'. ר\' את הרישיון הציבורי הכללי של GNU לפרטים נוספים.

