	'messages:config-sqlite-dir-help' => 'he:SQLite שומר את כל הנתונים בקובץ אחד.

לשרת הווב צריכה להיות הרשאה לכתוב לתיקייה שמוגדרת כאן.

היא <strong>לא</strong> צריכה נגישה לכולם דרך הווב – בגלל זה איננו שמים אותה באותו מקום עם קובצי ה־PHP.

תוכנת ההתקנה תכתוב קובץ <code dir="ltr">.htaccess</code> יחד אִתו, אבל אם זה ייכשל, מישהו יוכל להשיג גישה למסד הנתונים שלכם.
שם נמצא מידע מפורש של משתמשים (כתובות דוא״ל, סיסמאות מגובבות) וגם גרסאות מחוקות של דפים ומידע מוגבל אחר.

כדאי לשקול לשים את מסד הנתונים במקום אחר לגמרי, למשל ב־<code dir="ltr">/var/lib/mediawiki/yourwik</code>.',
