	'messages:config-pingback' => 'he:לשתף נתונים על ההתקנה הזאת עם מפתחי מדיה־ויקי.  [https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement מדיניות הפרטיות].',
	'messages:config-pingback-help' => 'he:אם האפשרות הזאת תיבחר, מדיה־ויקי תודיע לאתר https://www.mediawiki.org נתונים בסיסיים על מופע המדיה־ויקי הזה. הנתונים האלה כוללים, למשל, את סוג המערכת, גרסת ה־PHP, ושרת מסד הנתונים שבחרת. קרן ויקימדיה משתפת את הנתונים האלה עם מפתחי מדיה־ויקי כדי לעזור למאמצי הפיתוח העתידיים. הנתונים הבאים יישלחו מהמערכת שלך:
<pre>$1</pre>

אפשר לראות את מדיניות הפרטיות של האפשרות הזאת בדף https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement.

למידע כללי נוסף על האפשרות הזאת, ר\' https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgPingback.

לנתוני שיחה חוזרת (pingback) מצטברים, ר\' https://pingback.wmcloud.org/.',
