	'messages:config-license-pd' => 'he:נחלת הכלל',
	'messages:config-license-help' => 'he:אתרי ויקי ציבוריים רבים מפרסמים את כל התרומות [https://freedomdefined.org/Definition ברישיון חופשי].
זה עוזר ליצור תחושה של בעלות קהילתית ומעודד תרומה לאורך זמן.
זה בדרך כלל לא נחוץ לאתר ויקי פרטי או אתר של חברה מסחרית.

אם האפשרות להשתמש בטקסט מוויקיפדיה והאפשרות שוויקיפדיה תוכל תקבל עותקים של טקסטים מהוויקי שלך חשובות לך, כדאי לבחור ב<strong>{{int:config-license-cc-by-sa}}</strong>.

ויקיפדיה השתמשה בעבר ברישיון החופשי למסמכים של גנו (GNU FDL או GFDL).
הוא עדיין רישיון תקין, אבל קשה להבנה.
כמו־כן, קשה לעשות שימוש חוזר ביצירות שפורסמו לפי GFDL.',
