	'messages:managewiki-error-nopermission-remote' => 'he:תצורת הוויקי מוצגת לך מרחוק. אם יש לך הרשאות הפעלה בוויקי, יש לנווט לוויקי שלך כדי לשנות את התצורה שלו. אי־אפשר לערוך אותו מכאן.',
	'messages:managewiki-error-requirements-disabled' => 'he:לא ניתן להשבית את ההרחבה "$1" מכיוון שחסרות לך ההרשאות הנדרשות.',
	'messages:managewiki-error-requirements-enabled' => 'he:לא ניתן להפעיל את ההרחבה "$1" עקב כישלון במילוי הדרישות ההכרחיות עבורה.',
	'messages:managewiki-extension-settings' => 'he:ניהול אפשרויות תצורה זמינות עבור ההרחבה הזאת',
	'messages:managewiki-header-core' => 'he:באפשרותך לנהל את הגדרות הליבה של ויקי זה (כגון השם והשפה) מהחלונית הזאת. רק מפעילי חווה יכולים לשנות את האפשרויות האפורות. בסיום, יש ללחוץ על "שמירה" וההעדפות שלך ישתקפו אחרי כמה שניות.

אפשר לנהל הגדרות נוספות כגון סמל ועוד בדף [[Special:ManageWiki/settings]].',
	'messages:managewiki-header-core-view' => 'he:יש לך הרשאה לצפות בהגדרות הליבה של הוויקי הזה מהחלונית הזאת אבל \'\'\'אין לך הרשאה לשנות אותן\'\'\'.

באפשרותף להציג הגדרות נוספות כגון סמל ועוד ב־[[Special:ManageWiki/settings]].',
	'messages:managewiki-header-extensions' => 'he:אפשר לנהל את ההרחבות ואת העיצובים של הוויקי הזה מהחלונית הזאת. החלונית הזאת משקפת את כל ההרחבות והעיצובים הזמינים. אם אינך רואה את התוסף או את העיצוב הנחוץ, נא לפנות למפעיל שלך.

בסיום, יש ללחוץ על "שמירה" וההרחבה או העיצוב שלך יותקנו בכמה שניות.',
	'messages:managewiki-header-extensions-view' => 'he:יש לך הרשאה לצפות בהרחבות ובעיצובים של הוויקי הזה מהחלונית הזאת, אבל \'\'\'אין לך הרשאה לנהל אותם\'\'\'. אם נחוצה לך הפעלה של הרחבה או עיצוב, נא לפנות למפעילי הוויקי הזה.',
	'messages:managewiki-header-namespaces' => 'he:אפשר לנהל את הגדרות מרחבי השם של הוויקי הזה מהלוח הזה. חלק מההגדרות ישתקפו רק לאחר הפעלת הרחבה. נא עיין בתיעוד של מדיה־ויקי למידע נוסף. בסיום, יש ללחוץ על "שמירה" וההעדפות שלך ישתקפו אחרי כמה שניות.',
	'messages:managewiki-header-namespaces-view' => 'he:יש לך הרשאה לצפות בהגדרות מרחב השם של הוויקי הזה מהחלונית הזאת אבל \'\'\'אין לך הרשאה לשנות אותן\'\'\'. נא לפנות למפעילי הוויקי שלך נחוצה לך עזרה נוספת.',
	'messages:managewiki-header-permissions' => 'he:אפשר לנהל את הגדרות קבוצות המשתמשים של הוויקי הזה מהחלונית הזאת (כגון הרשאות, הקצאות קבוצה וקידום אוטומטי). נא לקרוא את התיעוד בזהירות רבה ולא למחוק קבוצות בחוסר־אחריות או שהוויקי שלך עלול להתקלקל. בסיום, יש ללחוץ על "שמירה" וההעדפות שלך ישתקפו אחרי כמה שניות.

לא ניתן להקצות את כל ההרשאות. הרשאות משתמש מסוימות עשויות להיות שמורות רק למפעילי חוות. נא ליצור קשר עם החווה שלך אם לא הצלחת למצוא הרשאות מסוימות.',
	'messages:managewiki-header-permissions-view' => 'he:יש לך הרשאה לצפות בהגדרות קבוצות המשתמשים של הוויקי הזה מהחלונית הזאת אבל \'\'\'אין לך הרשאה לשנות אותן\'\'\'. נא לפנות למפעילי הוויקי שלך נחוצה לך עזרה נוספת.',
	'messages:managewiki-header-settings' => 'he:אפשר לנהל את ההגדרות של הוויקי הזה (כגון סמל, סגנון ועוד) מהחלונית הזאת. זהירות! יש להקפיד לקרוא בעיון את תיאורי ההגדרות ולא להחליף הגדרות אקראיות ללא הבחנה אלא אם כן ברור לך מה זה עושה. בסיום, יש ללחוץ על "שמירה" וההעדפות שלך ישתקפו אחרי כמה שניות.

רק מפעילי חווה יכולים לשנות את האפשרויות האפורות. אפשר לנהל הגדרות ליבה כגון שם ויקי ושפה ב־[[Special:ManageWiki/core]].',
	'messages:managewiki-header-settings-view' => 'he:יש לך הרשאה לצפות בהגדרות של הוויקי הזה (כגון סמל, סגנון ועוד) מהחלונית הזאת אבל \'\'\'אין לך הרשאה לשנות אותן\'\'\'.

אפשר לנהל הגדרות ליבה נוספות כגון שם ויקי ושפה ב־[[Special:ManageWiki/core]].',
